import PropTypes from "prop-types";
import React from "react";
const leftArrow = "<";

function Pagination(props) {
    if (props.pagination === undefined) {
        return null;
    }
    const currentPage = props.pagination.page;
    const lastPage =  props.pagination.last;

    if (lastPage === 1 || props.noPageNeeded()) {
        return null;
    }
    if(lastPage === currentPage) {
        return (
            <React.Fragment>
                <button onClick={props.firstPage}> 1 </button>
                <button onClick={props.lastPage}> {leftArrow} </button>
                <button disabled> {currentPage} </button>
            </React.Fragment>
        )
    } else if (currentPage === 1 && lastPage !== 1) {
        return (
            <React.Fragment>
                <button disabled> 1 </button>
                <button onClick={props.nextPage}> > </button>
                <button onClick={props.lastPage}> {lastPage} </button>
            </React.Fragment>
        )
    } else if (currentPage === 2) {
        return (
            <React.Fragment>
                <button onClick={props.firstPage}> 1 </button>
                <button disabled> 2 </button>
                <button onClick={props.nextPage}> > </button>
                <button onClick={props.lastPage}> {lastPage} </button>
            </React.Fragment>
        )
    } else if (lastPage === 2 && currentPage === 2) {
        return (
            <React.Fragment>
                <button onClick={props.firstPage}> 1 </button>
                <button disabled> 2 </button>
            </React.Fragment>);
    } else if (lastPage === 2 && currentPage === 1) {
        return (
            <React.Fragment>
                <button disabled > 1 </button>
                <button onClick={props.lastPage}> 2 </button>
            </React.Fragment>);
    }
    return (
        <React.Fragment>
            <button onClick={props.firstPage}> 1 </button>
            <button onClick={props.previousPage}> {leftArrow} </button>
            <button disabled> {currentPage} </button>
            <button onClick={props.nextPage}> > </button>
            <button onClick={props.lastPage}> {lastPage} </button>
        </React.Fragment>);
}


export default Pagination;

Pagination.propTypes = {
    pagination: PropTypes.any,
    nextPage: PropTypes.func,
    previousPage: PropTypes.func.isRequired,
    firstPage: PropTypes.func.isRequired,
    lastPage: PropTypes.func.isRequired,
    noPageNeeded: PropTypes.func.isRequired,
};
